import React, { useState } from 'react';
import { Menu, X } from 'lucide-react'; // Optional: lucide für Icons

const Navbar: React.FC = () => {
    const [menuOpen, setMenuOpen] = useState(false);

    return (
        <nav className="bg-white shadow-md fixed w-full z-10">
            <div className="max-w-7xl mx-auto px-4 py-4 flex justify-between items-center">
                <div className="text-xl font-bold text-blue-600">Azubihilfe Netzwerk</div>

                {/* Desktop Links */}
                <div className="hidden md:flex space-x-6">
                    <a href="/" className="text-gray-700 hover:text-blue-500">Home</a>
                    <a href="#features" className="text-gray-700 hover:text-blue-500">Features</a>
                    <a href="/kontakt" className="text-gray-700 hover:text-blue-500">Kontakt</a>
                </div>

                {/* Mobile Button */}
                <div className="md:hidden">
                    <button onClick={() => setMenuOpen(!menuOpen)}>
                        {menuOpen ? <X className="w-6 h-6" /> : <Menu className="w-6 h-6" />}
                    </button>
                </div>
            </div>

            {/* Mobile Links */}
            {menuOpen && (
                <div className="md:hidden bg-white px-4 pb-4 space-y-2">
                    <a href="#home" className="block text-gray-700 hover:text-blue-500">Home</a>
                    <a href="#features" className="block text-gray-700 hover:text-blue-500">Features</a>
                    <a href="#kontakt" className="block text-gray-700 hover:text-blue-500">Kontakt</a>
                </div>
            )}
        </nav>
    );
};

export default Navbar;
